import styled from "styled-components";


export const Conteudo = styled.div`
display:flex;
width:100%;
height:50px;
`;

export const Cabeçario = styled.nav`
    display:flex;
    width:80%;
    background-color:#000;
    height:50px;
    flex-direction:row;
    align-items:center;
    justify-content:flex-end;
  ul{
    padding:50px;
  }  
  li{
    padding:50px;   
  }
`;
